// Conference
window.conference = {
    config: {
        baseurl: '/uplc2025'
    },

    ready: false,
    awaitReady: () => {
        const poll = (resolve) => {
            if(window.conference.ready === true) {
                resolve();
            }
            else {
                setTimeout(() => poll(resolve), 500);
            }
        }
        return new Promise(poll);
    }
};


