window.conference.map = (() => {
    let config;
    let lang;

    let map;

    const setup = (elId) => {
        map = L.map(elId).setView(config.home_coord, config.default_zoom);

        L.tileLayer.provider(config.map_provider).addTo(map);

        L.easyButton('far fa-star', () => {
            map.flyTo(config.home_coord, config.default_zoom);
        }, lang.focus_conf).addTo(map);

        L.control.locate({
            flyTo: true,
            strings: {
                title: lang.focus_me
            }
        }).addTo(map);
    };

    const init = (c, l) => {
        config = c;
        lang = l;

        const elId = 'map';

        if (document.getElementById(elId)) {
            setup(elId);
        }
    };

    const getMap = () => {
        return map
    };

    return {
        init: init,
        getMap: getMap
    };
})();



// Modals ("Popups")
window.conference.modal = (() => {

    const show = (el, event) => {
        const button = $(event.relatedTarget);

        const href = button.data('href');
        const format = button.data('format');
        const title = button.data('title');
        const subtitle = button.data('subtitle');
        const footer = button.data('footer');

        const modal = $(el);
        modal.find('iframe').attr('src', href);

        if (title) {
            if (format == 'html') {
                modal.find('.modal-title h3').html(title);
                if (subtitle) {
                    modal.find('.modal-title h5').html(subtitle).removeClass('d-none');
                }
                else {
                    modal.find('.modal-title h5').text('').addClass('d-none');
                }
            }
            else {
                modal.find('.modal-title h3').text(title);
                if (subtitle) {
                    modal.find('.modal-title h5').text(subtitle).removeClass('d-none');
                }
                else {
                    modal.find('.modal-title h5').text('').addClass('d-none');
                }
            }
        }
        else {
            modal.find('.modal-title h3').text('');
            modal.find('.modal-title h5').text('').addClass('d-none');
        }

        if (footer) {
            modal.find('.modal-footer').removeClass('d-none');
            if (format == 'html') {
                modal.find('.modal-footer p').html(footer);
            }
            else {
                modal.find('.modal-footer p').text(footer);
            }
        }
        else {
            modal.find('.modal-footer').addClass('d-none');
        }
    };

    const hide = (el) => {
        const modal = $(el);

        modal.find('.modal-title h3').text('');
        modal.find('.modal-title h5').text('').addClass('d-none');
        modal.find('iframe').attr('src', '');
        modal.find('.modal-footer p').html('');
    };

    const init = () => {
        const elSel = '#link-modal';

        $(elSel).on('show.bs.modal', function (event) {
            show(this, event);
        });
        $(elSel).on('hide.bs.modal', function () {
            hide(this);
        });
    };

    return {
        init: init
    };

})();


// Live and Streaming


// Load configuration and start initialization
const init = () => {
    // Load configuration
    const request = new Request(window.conference.config.baseurl + '/assets/js/config.json');

    fetch(request)
    .then(response =>
        response.json()
    )
    .then(config => {
        // Add configuration to global scope
        window.conference.config = Object.assign(window.conference.config, config);

        // Execute initialization functions
        for (const [name, module] of Object.entries(window.conference)) {
            if (['config','ready','awaitReady'].includes(name)) {
                continue;
            }

            let c;
            if (name in config) {
                c = config[name];
            }
            let l;
            if (name in config.lang) {
                l = config.lang[name];
            }

            module.init(c, l);
        }

    }).then(() => {
        window.conference.ready = true;
    })
    .catch((error) => {
        console.log(error);
    });
};

init();


